import React from 'react';

function Privacy() {
  return (
    <div className="privacy">
      <h1>Privacy Policy</h1>
      <p>Include your privacy policy here. Mention how you handle user data, what is collected, stored, and shared, and users' rights to their data.</p>
    </div>
  );
}

export default Privacy;
